import React, { Component } from 'react';
import { Form, Input } from 'reactstrap';
import { Badge } from 'reactstrap';
import { Calendar } from 'react-date-range';
import DateRangePicker from 'react-bootstrap-daterangepicker';
import 'bootstrap-daterangepicker/daterangepicker.css';
import { getRangeOfDates } from 'helper.js';

import * as moment from 'moment';





class Home extends Component {

    constructor() {
        super();

        this.bookedOutDates = [];
        this.dateRef = React.createRef();

        this.state = {
          proposedBooking: {
            startAt: '',
            endAt: '',
            guests: '',
            paymentToken: ''
          },
          modal: {
            open: false
          },
          errors: []
        }

        this.checkInvalidDates = this.checkInvalidDates.bind(this);
        this.handleApply = this.handleApply.bind(this);
        this.cancelConfirmation = this.cancelConfirmation.bind(this);
        this.reserveRental = this.reserveRental.bind(this);
        this.setPaymentToken = this.setPaymentToken.bind(this);
      }

    componentWillMount() {
        this.getBookedOutDates();
      }

      getBookedOutDates() {
        const {bookings} = this.props.rental;

        if (bookings && bookings.length > 0) {
          bookings.forEach(booking => {
            const dateRange = getRangeOfDates(booking.startAt, booking.endAt, 'Y/MM/DD');
            this.bookedOutDates.push(...dateRange);
          });
        }
      }

      checkInvalidDates(date) {
        return this.bookedOutDates.includes(date.format('Y/MM/DD')) || date.diff(moment(), 'days') < 0;
      }

      handleApply(event, picker) {
        const startAt = picker.startDate.format('Y/MM/DD');
        const endAt = picker.endDate.format('Y/MM/DD');

        this.dateRef.current.value = startAt + ' to ' + endAt;

        this.setState({
          proposedBooking: {
            ...this.state.proposedBooking,
            startAt,
            endAt
          }
        });
      }

    render() {

        return (
            <div class="bg">
                <div className="text-center">

                    <div className="landingpage-style">
                        <h1>Road Trip Advisor</h1>
                        <p> Share Road Trip Advisor with your friends!</p>
                    </div>
                    <div class="container my-1">
                        <div class="row text-center pb-1">

                        </div>
                        <div class="row">
                            <div class="col-md-12">
                                <div class="card acik-renk-form">
                                    <div class="card-body">
                                        <div class="row">
                                            <div class="col-md-3">
                                                <div class="form-group ">
                                                    <input type="Location" class="form-control" id="exampleFormControlInput1" placeholder="Starting From" />
                                                </div>
                                            </div>


                                            <div class="col-md-3">
                                                <div class="form-group ">
                                                    <input type="Destination" class="form-control" id="exampleFormControlInput1" placeholder="Destination" />

                                                </div>
                                            </div>

                                            <div class="col-md-3 ">
                                                <div class="form-group ">

                                                    <DateRangePicker onApply={this.handleApply}
                                                        isInvalidDate={this.checkInvalidDates}
                                                        opens='left'
                                                        containerStyles={{ display: 'block' }}>
                                                        <input ref={this.dateRef} id='dates' type='text' className='form-control'></input>
                                                    </DateRangePicker>

                                                </div>
                                            </div>

                                            <div class="col-md-3 ">
                                                <div class="form-group ">

                                                    <input type="time" placeholder="Return" className="form-control" />

                                                </div>
                                            </div>

                                        </div>
                                        <div class="row">
                                            <div class="col-md-9">
                                                <div class="form-group ">
                                                </div>
                                            </div>

                                            <div class="col-md-3">
                                                <button
                                                    type="button"
                                                    class="btn btn-warning  pl-5 pr-5">

                                                    Search </button>
                                            </div>
                                        </div>
                                    </div>
                                </div>

                            </div>
                        </div>
                    </div>

                </div>
            </div>



        );
    }
}



export default Home;
